  return (
    <div className={classes.banner}>
      <div className={classes.banner-div}>
        <h2 className={classes.banner-heading}>GGG</h2>
        <p>jjj</p>
        <div>
          <button>ddd</button> <button>ddd</button>
        </div>
      </div>
    </div>
  );
};

export default Banner;
